  /// <summary>
  /// Send data in cleartext
  /// </summary>
  /// <param name="meta">
  /// Framing data.
  /// </param>
  /// <param name="cleartext">
  /// Cleartext to send
  /// </param>
  /// <param name="startIndex">
  /// Start index for reading from buffer
  /// </param>
  /// <param name="count">
