  static FromCompressedPoint(compressed: CompressedRistretto): RistrettoPoint {
    const bytes = compressed.ToBytes()
    const ep = EdwardsPoint.FromCompressedPoint(bytes.slice())
    return new RistrettoPoint(ep)
  }

