const WORDS_MAP = DEFAULT_WORDLIST.split('|').reduce<Record<string, number>>((acc, elem, index) => {
  acc[elem] = index
  return acc
}, {})

// returns the first n bits of the sha256 hash of the input
// n is the length of the entropy in bytes divided by 4
// for 12 word mnemonics, n = 16 / 4 = 4
// for 15 word mnemonics, n = 20 / 4 = 5
// and so on
const sha256FirstNBits = (entropy: Uint8Array): string =>
  sha256(entropy)[0]
    .toString(2)
    .padStart(8, '0')
    .slice(0, entropy.length / 4)

export const mnemonicToEntropy = (mnemonic: string): Uint8Array => {
  const words = (mnemonic.normalize('NFKD')).split(' ').filter(word => !!word)

  if (words.length % 3 !== 0 || words.length < 12 || words.length > 24) {
    throw new Error(INVALID_MNEMONIC)
  }

  // convert word indices to 11 bit binary strings
  const bits = words
    .map((word): string => {
      if (!(word in WORDS_MAP)) {
        throw new Error(INVALID_MNEMONIC)
      }

      const index = WORDS_MAP[word]

      return index.toString(2).padStart(11, '0')
    })
    .join('')

  const dividerIndex = bits.length - (words.length / 3)
  const entropyBits = bits.slice(0, dividerIndex)
  const checksumBits = bits.slice(dividerIndex)

  // calculate the checksum and compare
  const matched = entropyBits.match(/(.{1,8})/g)
  const entropyBytes = matched?.map(bin => parseInt(bin, 2))

  if (!entropyBytes || (entropyBytes.length % 4 !== 0) || (entropyBytes.length < 16) || (entropyBytes.length > 32)) {
    throw new Error(INVALID_ENTROPY)
  }

  const entropy = Uint8Array.from(entropyBytes)

  if (sha256FirstNBits(entropy) !== checksumBits) {
    throw new Error(INVALID_CHECKSUM)
  }

  return entropy
}

export function entropyToMnemonic(entropy: Uint8Array): string {
  // entropy length should be one of [16, 20, 24, 28, 32]
  if ((entropy.length % 4 !== 0) || (entropy.length < 16) || (entropy.length > 32)) {
    throw new Error(INVALID_ENTROPY)
  }

  const entropyInBinaryForm = Array.from(entropy)
    .map(byte => byte.toString(2).padStart(8, '0')).join('')

  const entropyWithChecksum = entropyInBinaryForm + sha256FirstNBits(entropy)

  const splittedBy11BinaryDigits = entropyWithChecksum.match(/(.{1,11})/g)
  const wordNumbers = splittedBy11BinaryDigits?.map(binary => parseInt(binary, 2))

  if (!wordNumbers || (wordNumbers.length < 12)) {
    throw new Error('Unable to map entropy to mnemonic')
  }

  const WORDLIST = DEFAULT_WORDLIST.split('|')
  const words = wordNumbers.map((wordNumber) => WORDLIST[wordNumber])

  return words.join(' ')
}

export const generateMnemonic = (strengthInBits = 128): string => {
  return entropyToMnemonic(randomBytes(strengthInBits / 8)).toString().trim()
}

export const validateMnemonic = (mnemonic: string): {result: true, error: null} | {result: false, error: Error} => {
  try {
    mnemonicToEntropy(mnemonic)
  } catch (e: any) {
    return {
      result: false,
      error: e as Error,
    }
  }

  return {
    result: true,
    error: null,
  }
}
const mnemonicToEntropyAndSalt = (mnemonic: string, password = ''): {entropy: Uint8Array, salt: Uint8Array} => {
  const validationResult = validateMnemonic(mnemonic)
  if (!validationResult.result) {
    throw new Error(`Invalid bip39 mnemonic specified: ${validationResult.error.toString()}`)
  }
  const entropy: Uint8Array = mnemonicToEntropy(mnemonic)
  const salt: Uint8Array = new TextEncoder().encode(`mnemonic${password}`)

  return {entropy, salt}
}

export const mnemonicToMiniSecretAsync = async(mnemonic: string, password = ''): Promise<Uint8Array> => {
  const {entropy, salt} = mnemonicToEntropyAndSalt(mnemonic, password)
  // return the first 32 bytes as the seed
  const result = await pbkdf2Async(sha512, entropy, salt, {c: 2048, dkLen: 64})
  return result.slice(0, 32)
}

export const mnemonicToMiniSecret = (mnemonic: string, password = ''): Uint8Array => {
  const {entropy, salt} = mnemonicToEntropyAndSalt(mnemonic, password)

  // return the first 32 bytes as the seed
  const result = pbkdf2(sha512, entropy, salt, {c: 2048, dkLen: 64})
  return result.slice(0, 32)
}
/**
 Converts a string to a Uint8Array
 @example b`hello world` // Uint8Array(11) [104, 101, 108, 108, 111, 32, 119, 111, 114, 108, 100]
 */
export const b = (tmpl: TemplateStringsArray, ...values: any[]): Uint8Array => {
  return new TextEncoder().encode(String.raw(tmpl, ...values))
}

/**
 * Converts a hex string to a Uint8Array
 * @example hex`0x01020304` // Uint8Array(4) [1, 2, 3, 4]
 * @example hex`01020304`   // Uint8Array(4) [1, 2, 3, 4]
 */
export const hex = (tmpl: TemplateStringsArray, ...values: any[]): Uint8Array => {
  let str = String.raw(tmpl, ...values)
  if (str.startsWith('0x')) {
    str = str.slice(2)
  }
  if (!str.match(/^[0-9a-fA-F]+$/)) {
    throw new Error(`Invalid hex string: ${str}`)
  }
  return new Uint8Array((str.match(/.{1,2}/g) || []).map(b => parseInt(b, 16)))
}
// translated from the original Rust version of Strobe128
// https://github.com/dalek-cryptography/merlin/blob/53535f32e6d6de421372d67f56176af0c0f55fd7/src/strobe.rs
import {b} from '../templateLiteralFunctions'

import {keccakP} from '@noble/hashes/sha3'
const keccakF1600 = (state: Uint8Array) => {
  keccakP(new Uint32Array(state.buffer, state.byteOffset, Math.floor(state.byteLength / 4)), 24)
}

const STROBE_R = 166

const FLAG_I = 1
const FLAG_A = 1 << 1
const FLAG_C = 1 << 2
const FLAG_T = 1 << 3
const FLAG_M = 1 << 4
const FLAG_K = 1 << 5

export class Strobe128 {
  private readonly state: Uint8Array
  private pos: number
  private pos_begin: number
  private cur_flags: number

  constructor(protocol_label: Uint8Array) {
    const initial_state = new Uint8Array(200)
    initial_state[0] = 1
    initial_state[1] = STROBE_R + 2
    initial_state[2] = 1
    initial_state[3] = 0
    initial_state[4] = 1
    initial_state[5] = 96
    initial_state.set(b`STROBEv1.0.2`, 6)
    keccakF1600(initial_state)

    this.state = initial_state
    this.pos = 0
    this.pos_begin = 0
    this.cur_flags = 0

    this.meta_ad(protocol_label, false)
  }

  /// /////////////////////////////////////
  // public methods
  /// /////////////////////////////////////

  public meta_ad(data: Uint8Array, more: boolean): void {
    this.begin_op(FLAG_M | FLAG_A, more)
    this.absorb(data)
  }

  public ad(data: Uint8Array, more: boolean): void {
    this.begin_op(FLAG_A, more)
    this.absorb(data)
  }

  public prf(data: Uint8Array, more: boolean): void {
    this.begin_op(FLAG_I | FLAG_A | FLAG_C, more)
    this.squeeze(data)
  }

  public key(data: Uint8Array, more: boolean): void {
    this.begin_op(FLAG_A | FLAG_C, more)
    this.overwrite(data)
  }

  public clone(): Strobe128 {
    const clone: Strobe128 = new Strobe128(new Uint8Array(0))
    clone.state.set(this.state)
    clone.pos = this.pos
    clone.pos_begin = this.pos_begin
    clone.cur_flags = this.cur_flags
    return clone
  }

  public cloneState() {
    return {
      state: this.state.slice(),
      pos: this.pos,
      pos_begin: this.pos_begin,
      cur_flags: this.cur_flags,
    }
  }

  /// /////////////////////////////////////
  // private methods
  /// /////////////////////////////////////
  private run_f(): void {
    this.state[this.pos] ^= this.pos_begin
    this.state[this.pos + 1] ^= 0x04
    this.state[STROBE_R + 1] ^= 0x80
    keccakF1600(this.state)
    this.pos = 0
    this.pos_begin = 0
  }

  private absorb(data: Uint8Array): void {
    for (let i = 0; i < data.length; i++) {
      this.state[this.pos] ^= data[i]
      this.pos++
      if (this.pos === STROBE_R) {
        this.run_f()
      }
    }
  }

  private overwrite(data: Uint8Array): void {
    for (let i = 0; i < data.length; i++) {
      this.state[this.pos] = data[i]
      this.pos++
      if (this.pos === STROBE_R) {
        this.run_f()
      }
    }
  }

  private squeeze(data: Uint8Array): void {
    for (let i = 0; i < data.length; i++) {
      data[i] = this.state[this.pos]
      this.state[this.pos] = 0
      this.pos++
      if (this.pos === STROBE_R) {
        this.run_f()
      }
    }
  }

  private begin_op(flags: number, more: boolean): void {
    // Check if we're continuing an operation
    if (more) {
      if (this.cur_flags !== flags) {
        throw new Error(`You tried to continue op ${this.cur_flags.toString(2)} but changed flags to ${flags.toString(2)}`)
      }
      return
    }

    // Skip adjusting direction information (we just use AD, PRF)
    if ((flags & FLAG_T) !== 0) {
      throw new Error('You used the T flag, which this implementation doesn\'t support')
    }

    const old_begin = this.pos_begin
    this.pos_begin = this.pos + 1
    this.cur_flags = flags

    this.absorb(new Uint8Array([old_begin, flags]))

    // Force running F if C or K is set
    const force_f = (flags & (FLAG_C | FLAG_K)) !== 0
    if (force_f && this.pos !== 0) {
      this.run_f()
    }
  }
}
